deck_description:
One of my first video games as a kid was Jet Set Radio Future, and I would just absolutely LOVE playing it! I'd be glued to my XBOX for hours, grinding and spraying graffiti everywhere. And one of my favorite songs from the official soundtrack was "The Concept of Love." <a>https://www.youtube.com/watch?v=4V4IEV8l-gA</a>

&nbsp;

Plus, I've heard that Japan has some really bizarre trains. That is what inspired me to make this deck: My nostalgia and my love of Japan. This honestly functions like your typical Train deck, blindly going second and trying to OTK your opponent. To prevent your opponent from making plays, this deck uses a total of 12 hand traps, although cards that help you OTK are also in the Side Deck.

